import React from 'react';
import { Form, Input, Button, Card } from 'antd';

const Profile = () => {
    return (
        <>
            <br />
            <div>
                <Card
                title="닉네임 수정">
                <Form style={{ margin : '10px'}}>
                    <Input ></Input>
                    <Button type="primary" style={{ margin: '10px 10px', float : 'right'}}>수정</Button>
                </Form>
                </Card>
                <Card
                    size="small"
                    title="Follow">

                </Card>
                <Card
                    size="small"
                    title="Following">

                </Card>
            </div>
        </>
    );
};

export default Profile;
